import React from 'react';
import './MediaCard.css'; // Import your CSS file for styling

const MediaCard = ({ title, image, rating }) => {
  return (
    <div className="media-card">
      <img src={image} alt={title} className="media-image" />
      <h2 className="media-title">{title}</h2>
      <p className="media-rating">Rating: {rating}</p>
      <button className="modify-button">Modify</button>
    </div>
  );
};

export default MediaCard;
